INSERT INTO `posts` (`id`, `title`, `star`, `labelCode`, `address`, `attributesId`, `categoryCode`, `description`, `userId`, `overviewId`, `imagesId`, `createdAt`, `updatedAt`) VALUES
('0193b62e-283b-4b16-a263-61d70ca786d8', 'Nhà riêng đẹp quận 7 gần Lotte Mart cho thuê', NULL, 'IOX5', 'Địa chỉ: 503 Phố Trần Xuân Soạn, Phường Tân Kiểng, Quận 7, Hồ Chí Minh', '0a4197fc-33b0-4a30-9bb6-bd0e17d8c46b', 'NCT', '[\"Nhà riêng biệt lâp quận 7 cho thuê, DTSD: (3,2*8,0 + gác lửng 3,2*6,0) = 41 m2, hẻm cụt, yên tĩnh đường Trần Xuân Soạn, nhà đẹp, hướng nam thoáng mát, cách đường lớn 40m, cách cẩu Kênh Tẻ 500m, rất tiện đi trung tâm TP (2km), cách KĐT Phú Mỹ Hưng 2km, cách ST Lotte Mart 1km, hẻm trước nhà 2.4m, khu dân cư an ninh. Điện nước giá chính thức theo Hóa đơn của Nhà nước.\",\"Giá 4 triệu/ tháng. LH: chính chủ Minh – 0903.096.172.\"]', '6d58dff5-72f7-4eae-969a-bfeab3242638', '21765416-73b0-4e05-9785-f1645055f993', 'bd66167c-c81f-4c82-9ec1-6d52bb9db00e', '2023-03-31 18:14:03', '2023-03-31 18:14:03'),
('01ea183d-12b7-458c-a1f2-1a97cf77aab3', 'Phòng trọ sleepbox 5 phút tới sân bay đường Phạm Văn Đồng gò vấp giá 1,9tr 0792686899', '4', 'RPI2', 'Địa chỉ: Đường Phạm Văn Đồng, Phường 1, Quận Gò Vấp, Hồ Chí Minh', 'f0a6cca4-261f-41e9-ab8f-3b7c5bf0040b', 'CTPT', '[\"Vị trí ngay khúc giao Lê Quang Định và Phạm Văn Đồng, Quận Gò Vấp.\",\"Thuận tiện di chuyển tới sân bay chỉ 6 phút, chỉ 5 phút qua Emart , Vimcom, 6 phút di chuyển đến Sân Bay\",\"Đi bộ qua chợ Gò Vấp và DH Công Nghiệp chỉ 5 phút, thuận tiện di chuyển qua các Quận lận cận như: Phú Nhuận, Bình Thạnh, Thủ Đức, Quận 12, Tân Bình,...\",\"Toà nhà mới, Bảo mật 2 lớp Camera Face ID hồng ngoại khi vào cổng cực kì an ninh, khu dân trí cao.\",\"Sleepbox có cửa khoá riêng bằng THẺ TỪ, an toàn tuyệt đối.\",\"Tiện ích cao cấp đầy đủ: Tủ treo quần áo, kệ sách trong phòng, máy giặc, sân phơi, tủ lạnh, thiết bị khu bếp đầy đủ.\",\"Đặc biệt: THƯ VIỆN tri thức cho các bạn tha hồ sáng tạo\",\"Bàn giao Sleepbox bạn sẽ có nệm, drap, mền, gối đầy đủ\",\"Phòng máy lạnh 24/24, wifi free, 2-4 toilet riêng từng phòng.\",\"Khu vực chung có: tủ lạnh, máy giặt, bếp từ, lò vi sóng, ấm siêu tốc, nồi cơm điện, máy nước nóng... Chỗ phơi đồ và ủi đồ.\",\"Tất cả tiện nghi đã bao gồm trong giá thuê. Hệ thống an ninh vân tay và khóa từ, camera hồng ngoại xung quanh, đảm bảo an ninh 24/7 tuyệt đối.\",\"Hiện tại ở khu vực Hồ Chí Minh bên mình có hơn 10 chi nhánh làm sleepbox. Liên hệ mình số zl ở dưới nha\",\" \",\" \"]', '1f332209-08b4-4447-adcc-8222df29be82', '9ba8880d-01c8-4d49-b367-2b673243cd33', '58ca966f-637d-4658-bc04-8b2cdd4c9cda', '2023-03-31 18:14:03', '2023-03-31 18:14:03'),
('09170e5c-3f88-4c38-a6df-7055af3fa10d', 'Phòng ban công 35m2 full nội thất cạnh Lotte Q7', '5', 'XJW5', 'Địa chỉ: 17 30, Phường Tân Phong, Quận 7, Hồ Chí Minh', '099df4ee-5eb0-4009-acaf-41d53e545eb6', 'CTPT', '[\"Phòng trọ được trang bị đầy đủ nội thất bao gồm: giường, tủ, bàn làm việc, tủ quần áo siêu rộng, máy lạnh, máy giặt, máy nước nóng, kệ bếp và phòng tắm riêng khép kín.\",\"Vị trí phòng trọ tại số 17 đường số 30, phường Tân Phong, Quận 7, nằm trong khu vực đắc địa, dân trí cao và có thể di chuyển bằng ô tô vào tận cửa. Gần các tiện ích như công viên, siêu thị BHX, quán cafe Cộng và chỉ cách Lotte Mart 500m, Đại học Tôn Đức Thắng 0,7km, Đại học Nguyễn Tất Thành 1km và Đại học Marketing 2km. Từ địa điểm này, bạn có thể di chuyển đến các quận trung tâm như Quận 1, Quận 4, Quận 5... chỉ trong vòng 5 phút.\",\"Liên hệ để được tư vấn và xem phòng chi tiết qua Zalo số 0832232232.\",\"Địa chỉ: Số 17 đường số 30, phường Tân Phong, Quận 7.\"]', 'ebb176b5-5016-4931-8198-56094ce859c4', 'dd4833ea-c133-4354-900c-5cce6d723f64', '55ef4437-91ac-4366-ade5-89203d7c4a96', '2023-03-31 18:14:03', '2023-03-31 18:14:03'),
('0baf40d2-d8f0-4882-8596-40bd6aff6e8e', 'Cho thuê phòng giờ giấc tự do nội thất mới cao cấp, hẻm xe hơi', '3', 'RRC4', 'Địa chỉ: 21/20 Đường Trần Đình Xu, Phường Cầu Kho, Quận 1, Hồ Chí Minh', '291d6e8b-7536-4a17-b08a-41a8200a8b32', 'CTCH', '[\"Cho thuê phòng đẹp, đầy đủ tiện nghi, GIỜ tự do, an ninh 100%, Quận 1.\",\"Gần khu Phố Tây Bùi Viện, gần chợ Bến Thành.\",\"- Nằm ở trung tâm thành phố, địa chỉ 21/20 Trần Đình Xu, P. Cầu Kho, Q1.\",\"- Nhà mới xây, rất đẹp, vào là ở ngay, thiết kế đẹp, thoáng như khách sạn. Diện tích phòng từ 15 đến 30 m2. Có đầy đủ các tiện nghi như: Giường, nệm, tủ đựng quần áo, máy lạnh, WC riêng, hệ thống máy nước nóng lạnh.\",\"- Wifi cáp quang 24/24, truyền hình cáp, có chỗ để xe và gắn camera quan sát. Đặc biệt: Có cung cấp đầy đủ vệ sinh phòng, giặt ủi, được nấu ăn trong phòng.\",\"- Mang đến cuộc sống tự do thoải mái như chính trong ngôi nhà của bạn.\",\"- Gửi xe trong nhà an toàn, có camera theo dõi, an ninh 100%. Hoàn toàn yên tâm không lo lắng về xe cộ khi về nhà.\",\"- Mọi người sống thân thiện, gần gũi, vui vẻ.\",\"* Thuộc khu dân trí cao, an ninh đảm bảo, ngay trung tâm quận 1.\",\"* Gần Chợ, nhà Thờ, Khu Ăn Uống, Khu vui chơi Giải trí.\",\"* Cạnh khu phố Tây, Đường Đề Thám, Phạm Ngũ Lão.\",\"Giá thuê:\",\"Chỉ từ 5tr5 - 6tr5 đồng/một tháng cho các loại phòng 30 đến 40 m2 là Bạn đã có thể tận hưởng cuộc sống trong căn phòng (máy lạnh, bình nóng lạnh, cửa sổ nhìn ra ngoài thông thoáng, hỗ trợ giường nệm, Tủ quần áo, Tivi).\",\"Địa chỉ: 21/20 Trần Đình Xu, P. Cầu Kho, Quận 1\",\"Đt: 0962.639.939 gap chị Ngoc để xem phòng\"]', '52e21d18-41f0-42df-8ecf-df92ca263843', '4cc11792-a9de-4b70-9c0d-2be4fdeb0066', 'be1379b5-f945-4e89-9b06-9371d2645856', '2023-03-31 18:14:03', '2023-03-31 18:14:03'),
