('937a8c85-931d-4891-95e7-3684ca3c498a', 'Cho Thuê nhà mới TRỆT LẦU 1745 Huỳnh Tấn Phát TT Nhà Bè 5tr/tháng đối diện chợ phú xuân', NULL, 'QUS4', 'Địa chỉ: 1745 Đường Huỳnh Tấn Phát, Thị trấn Nhà Bè, Huyện Nhà Bè, Hồ Chí Minh', '75cbea97-440d-49b0-a375-d931e665be6e', 'NCT', '[\"Cho thuê nhà nguyên căn mặt tiền bên hông cầu Phú Xuân 1745 Huỳnh Tấn Phát , Kp4, Nhà Bè giáp Q7, ngay cầu Phú Xuân 2, đối diện chợ Phú Xuân gần chợ nên rất tiện buôn bán , gần đó có uỷ ban nhân dân ,siêu thị, các ngân hàng đông á, sacombank, ACB, vietcombank, thế giới di động, ...\",\"Diện tích: 3x12m , nhà trệt lầu, 2 pn 1 lớn 1 nhỏ , 2 toilet , có ban công rộng thoáng mát giặt phơi đồ, phòng có cửa sổ thoáng mát, toilet, bếp, phòng khách bếp, sân để xe\",\"Khu vực để ở rất tiện đi 20m là vào chợ, kết hợp ở và buôn bán tiện lợi một số lĩnh vực gần chợ như quần áo, cắt tóc gội đầu, tạp hoá,buôn bán đồ ăn ... Nhóm sinh viên ở 4-5 người cách đại học marketing quận 7 khoảng 5km , ở gia đình 4-5 người , vừa ở vừa kinh doanh , giảm 5tr/tháng cho 6 tháng đầu cho người thuê dài hạn , thuê 2 năm giảm năm đầu còn 5tr\",\",\",\"Liên hệ chủ nhà : Long -0766802468\"]', '0a98ed8a-3715-45b1-a45c-a78aa17d9c1a', '436e0d07-8d03-4a42-8e45-85845da42059', '323c1e4d-504f-46b5-b23b-f83454762a7b', '2023-03-31 18:14:03', '2023-03-31 18:14:03'),
