('f76847b8-3ac1-4d20-904f-fcd4fad2c010', 'CHO THUÊ CHDV CAO CẤP NGAY SÂN BAY 45M2 CHỈ 8TR', '2', 'BKU8', 'Địa chỉ: Đường Trường Sơn, Phường 4, Quận Tân Bình, Hồ Chí Minh', '73ef9cdf-605b-454c-829b-e2aa0f549b3b', 'CTCH', '[\"Vị trí: Đường Trường Sơn, P4, Tân Bình. Nằm ngay trung tâm, thuận tiện đi lại các quận, gần sân bay.\",\"Full nội thất cao cấp, miễn phí giặt sấy, miễn phí dịch vụ, gửi xe FREE. Chủ nhà thân thiện, nhiệt tình.\",\"Khu vực cực kì an ninh, camera an ninh 24/7, ra vào khóa số và vân tay, giờ giấc tự do, xe hơi tới tận cửa.\",\"Phòng rộng rãi, thoáng mát, đầy đủ tiện nghi, ban công cửa sổ rộng lớn, view hồ bơi sang chảnh.\",\"- Giá: 8tr/tháng.\"]', '7f6c7012-9704-4c7b-80c6-91a9e68a36e0', 'f9adef8d-71f0-4686-8e8d-9b48a640bc66', '8b941dac-c743-4d1c-b028-0377da26ae26', '2023-03-31 18:14:03', '2023-03-31 18:14:03'),
('fab5b5bf-dd26-46d6-8ac8-7ecab03d91c8', 'Cho thuê mặt bằng kinh doanh ngay mặt tiền đường Bình Dương, Dĩ An, Bình Dương', NULL, 'RHJ4', 'Địa chỉ: 42 Bình Đường, Phường An Bình, Huyện Dĩ An, Bình Dương', '1a990790-c674-45dc-86b7-00ff887d5331', 'CTMB', '[\"GIẢM MẠNH 20% CHO 2 THÁNG ĐẦU TIÊN\",\"MẶT BẰNG CHO THUÊ, KINH DOANH CF, ĂN NHẸ, BUÔN BÁN ONLINE,....\",\"- Địa chỉ: Đường Bình Dương, Dĩ An, Bình Dương\",\"Rộng, thoáng mát, riêng biết\",\"Mới 100%\",\"Khu vực an ninh, nhộn nhịp\",\"Call ngay 0336.309.097 kẻo hết nhé\"]', '2d934266-0985-4774-a77c-fe8a7b27e1d5', '463784da-1b9b-42d2-9028-f2cd0c369c8e', '1255ce62-c2ca-4b49-a11b-9d316e4e92f9', '2023-03-31 18:14:03', '2023-03-31 18:14:03');
